export default function AttackBlock(props) {
    return (
        <div className="bg-[url('https://img.freepik.com/premium-vector/purple-color-cyber-security-concept-with-technology_1302-8584.jpg')] hover:scale-95 w-4/5 rounded-lg bg-[#3B3B3B] p-6 mb-12 p-12">
            <div>
                <img className="w-1/6" alt="" src={`${props.icon}`}/>
